import { Link } from "react-router-dom";
import "../header.css";
import {React} from "react";


function Header(){
    return(
        <div>
            <nav className="nvgbar">
                <ul style={{listStyleType:"none"}}>
                    <li>Home</li>
                    <li>Our Services</li>
                    <li>About Us</li>
                    <li>Extras</li>
                    <button onClick={<Link to="/login"></Link>} type="button" id="strbtn" className="strbtn">Get Started!</button>
                </ul>
                

                
            </nav>
        </div>
    );
}
export default Header
